/** 
 * Use the  {@param parameters} to set {@param hiveConf} or {@param hiveVariables} according towhat kinds of the parameter belongs.
 */
public static void setVariables(HiveConf hiveConf,Map<String,String> sessionConfigs,Map<String,String> parameters){
  for (  Map.Entry<String,String> entry : parameters.entrySet()) {
    String key=entry.getKey();
    if (key.startsWith(SET_PREFIX)) {
      String newKey=key.substring(SET_PREFIX.length());
      HiveSetProcessor.setVariable(hiveConf,sessionConfigs,newKey,entry.getValue());
    }
 else     if (!key.startsWith(USE_PREFIX)) {
      sessionConfigs.put(key,entry.getValue());
    }
  }
}
